Hollow Knight und die Switch 🗡👍😍
▪️▪️▪️
Kategorie „Besser spät als nie“ 😅🙈
▪️▪️▪️
Da ich in Zukunft sehr viel Zeit in Zügen verbringe, wenn ich zur Hochschule pendle, habe ich mein letztes Geld zusammengekratzt und mit eine gebrauchte Switch ersteigert. 
Bisher bin ich, obwohl ich sehr lange über diese Konsole gelacht habe, mehr als begeistert. 🙈🤗
Es ist einfach die perfekte Mischung aus Handheld und TV-Konsole. ▪️▪️▪️
Nun habe ich einen Riesen Stapel toller Spiele, die ich schon immer nachholen wollte.
▪️▪️▪️
Das ich ausgerechnet an einem „Souls-Jump&Run-Metroidvania“ hängenbleibe hätte ich aber nicht erwartet.
Vor allem da ich immer behauptet habe, dass ich Jump&Runs nicht mag 🙈😅
Hollow Knight ist genial. Es hat mich nach nur 2h mehr als süchtig gemacht. 
Ich kann es hier nicht so beschreiben wie ich es gerne würde... aber es sei gesagt: 
Ich liebe es!!!
▪️▪️▪️
